() => {
		if (QueryShipment.data.data.getOrder.shipments[ListShipmentDetail.selectedRowIndex].transportCompanyShipmentId == ""){
				return true
		}
		for (let i = 0; i < QueryShipment.data.data.getOrder.shipments[ListShipmentDetail.selectedRowIndex].items.length; i ++) {
			if (QueryShipment.data.data.getOrder.shipments[ListShipmentDetail.selectedRowIndex].items[i].transportCompanyItemId != "") {
				if (QueryShipment.data.data.getOrder.shipments[ListShipmentDetail.selectedRowIndex].items[i].transportCompanyItemId == null) {
					return true
				}
				return false
			}
		}
		return true
	}

